            <div className = "profile-detail">
                <h1 className = "profile-name">Heyy Folks!</h1>
                <p className>I am Ankit Bansal, Final Year Undergrad at Government Engineering College, Bilaspur </p>
            </div>
            </div>

        )

 }
}

export default LandingPage;
